import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/Home.css';
import videoBg from './your-video.mp4'; // Make sure video is in the same folder

function Home() {
  const navigate = useNavigate();

  return (
    <div className="home-page">
      {/* Video Background */}
      <div className="video-container">
        <video autoPlay loop muted playsInline>
          <source src={videoBg} type="video/mp4" />
        </video>
        <div className="overlay-content">
          <h1>Order Food Anytime, Anywhere üçî</h1>
          <p>Your favourite meals delivered hot & fresh!</p>
          <button onClick={() => navigate('/restaurants')}>Explore Restaurants</button>
        </div>
      </div>

      {/* Pink Section */}
      <section className="search-section">
        <h2>Discover the Best Restaurants</h2>
        <p>Search by location, cuisine, and more!</p>
        <button onClick={() => navigate('/restaurants')}>Search Restaurants</button>
      </section>

      {/* Features Section */}
      <section className="features">
        <div className="feature-card">üöÄ Super Fast Delivery</div>
        <div className="feature-card">üçΩÔ∏è Top Rated Restaurants</div>
        <div className="feature-card">üí∏ Affordable Prices</div>
        <div className="feature-card">üçï Great Food, Always!</div>
      </section>

      {/* Popular Dishes */}
      <section className="popular-section">
        <h2>Popular Picks</h2>
        <div className="carousel">
          <div className="dish-card">
            <img src="https://..." alt="Big Mac" />
            <p>Big Mac</p>
          </div>
          {/* more dishes... */}
        </div>
      </section>

      <footer className="footer">
        ¬© 2025 FoodExpress. All Rights Reserved.
      </footer>
    </div>
  );
}

export default Home;
